[package]
name = "addressbook"
version = "0.1.0"
edition = "2018"
publish = false [lib]
crate-type = ["cdylib"]
doc = false [dependencies]
eosio = { path = "../../crates/eosio" }
eosio_cdt = { path = "../../crates/eosio_cdt" } use eosio::*;
use eosio_cdt::*; eosio::abi!(add, update, erase, like, likezip); #[eosio::table("address")]
struct Address { #[eosio(primary_key)] account: AccountName, first_name: String, last_name: String, street: String, city: String, state: String, #[eosio(secondary_key)] zip: u32, liked: u64,
} #[eosio::action]
fn add( account: AccountName, first_name: String, last_name: String, street: String, city: String, state: String, zip: u32,
) { require_auth(account); let code = current_receiver(); let table = Address::table(code, code); let address = table.find(account); assert!(address.is_none(), "Address for account already exists"); let address = Address { account, first_name, last_name, street, city, state, zip, liked: 0, }; table.emplace(account, address).expect("write");
} #[eosio::action]
fn update( account: AccountName, first_name: String, last_name: String, street: String, city: String, state: String, zip: u32,
) { require_auth(account); let code = current_receiver(); let table = Address::table(code, code); let cursor = table.find(account).expect("Address for account not found"); let mut address = cursor.get().expect("read"); address.first_name = first_name; address.last_name = last_name; address.street = street; address.city = city; address.state = state; address.zip = zip; cursor.modify(Payer::Same, address).expect("write");
} #[eosio::action]
fn erase(account: AccountName) { require_auth(account); let code = current_receiver(); let addresses = Address::table(code, code); let cursor = addresses .find(account) .expect("Address for account not found"); cursor.erase().expect("read");
} #[eosio::action]
fn like(account: AccountName) { let code = current_receiver(); let addresses = Address::table(code, code); let cursor = addresses .find(account) .expect("Address for account not found"); let mut address = cursor.get().expect("read"); address.liked += 1; cursor .modify(Payer::New(address.account), address) .expect("write");
} #[eosio::action]
fn likezip(zip: u32) { let code = current_receiver(); let table = Address::by_zip(code, code); for cursor in table.lower_bound(zip).into_iter() { let mut addr = cursor.get().expect("read"); if addr.zip != zip { break; } addr.liked += 1; cursor.modify(Payer::Same, addr).expect("write"); }
}
